// Card.js
import React from 'react';

const Card = ({ data }) => {
  return (
    <div className="card">
      <h2 className="telescope-name">{data.telescopeName}</h2>
      <p className="time">Time: {data.time}</p>
      {/* <p className="coordinates">
        Coordinates: RA {data.DEC_RA.ra}, DEC {data.DEC_RA.dec}
      </p> */}
      <p className="event">Event: {data.event}</p>
      <p className="urgency">Urgency: {data.urgency}</p>
    </div>
  );
};

export default Card;
